import { useState } from "react"
import Navbar from "../Components/Navbar"



export default function Contact() {
    const [contactForm, setContactForm] = useState({
        firstName: "",
        lastName: "",
        email: "",
        message: ""
    })

    const handleChange = (e) => {
        const target = e.target
        const {name, value} = target

        setContactForm(prevForm => {
            return {
                ...prevForm,
                [name]: value
            }
        })
    }

    return (
        <div>
            <Navbar />
            <div className="contact-container">
                <div className="contact-image">Big Image</div>
                <form className="contact-form">
                    <label for="">First Name</label>
                    <input type="text" name="firstName" value={contactForm.firstName} onChange={(e)=> handleChange}/>
                </form>
                <div className="contact-map">map</div>
                <div className="contact-details">Contact details</div>
            </div>
        </div>
    )
}
